        <div>
        <h1 class="police-tape police-tape--1">
            &nbsp;&nbsp;&nbsp;&nbsp;Error: 403&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Error: 403&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Error: 403&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Error: 403&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Error: 403&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Error: 403&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Error: 403
        </h1>
        <h1 class="police-tape police-tape--2">No autorizado&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;No autorizado&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;No autorizado&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;No autorizado&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;No autorizado&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;No autorizado&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</h1>
        </div>
    );
}

export default Unauthorized;
